import { SET_USERNAME } from "./logInTypes";

const initialState = null;

const logInReducer = (state = initialState, action) => {
  switch (action.type) {
    case SET_USERNAME:
      return {
        ...state,
        username: action.payload
      };
    default:
      return state;
  }
};

export default logInReducer;
